Lets say you add more endpoints like POST, UPDATE, DELETE, PATCH and PUT like
import { createStar } from 'redux-nakshatra';

export const { rootSaga, types, actions, rootReducer } = createStar({
  name: 'users',
  http: {
    url: 'http://localhost:5000/users',
    add: {
      getUsers: {
        method: 'get'
      },
      postUser: {
        method: 'post'
      },
      patchUser: {
        method: 'patch'
      },
      deleteUser: {
        method: 'delete'
      },
      putUser: {
        method: 'put'
      }
    }
  }
});

generateDefault
You can imagine the amount of code you would have to write for this.
A even more handy property that you can provide is generateDefault: true and if you follow the REST pluralized conventions such as
GET: 'http://localhost:5000/users'; //returns all users
GET: 'http://localhost:5000/users/:id'; //returns a user
POST: 'http://localhost:5000/users'; // creates a new user
DELETE: 'http://localhost:5000/users/:id'; // deletes a user
PATCH: 'http://localhost:5000/users/:id'; // patches a user
PUT: 'http://localhost:5000/users/:id'; // replaces a user

you can just use the following configuration
import { createStar } from 'redux-nakshatra';

export const { rootSaga, types, actions, rootReducer } = createStar({
  name: 'users',
  http: {
    url: 'http://localhost:5000/users',
    generateDefault: true
  }
});

override
Not all APIs follow the same convention and when you need to change something small, you can use the override property
import { createStar } from 'redux-nakshatra';

export const { rootSaga, types, actions, rootReducer } = createStar({
  name: 'users',
  http: {
    url: 'http://localhost:5000/users',
    generateDefault: true,
    override: {
      getUser: {
        url: 'http://localhost:5000/user/:id'
      }
    }
  }
});

You can also add more endpoints along with default.
import { createStar } from 'redux-nakshatra';

export const { rootSaga, types, actions, rootReducer } = createStar({
  name: 'users',
  http: {
    url: 'http://localhost:5000/users',
    generateDefault: true,
    add: {
      findUsersByLastName: {
        method: 'get'
      }
    }
  }
});

// And Provide query params when invoking the action
actions.findUsersByLastName({
  params: {
    lastName: 'Andersson'
  }
});

Note: This library currently is dependent on axios for http requests. So the redux actions generated for http takes axios config parameters (Not all of them yet)

docs/config/graphql.html.body:
If you have a graphql backend, you can use graphql property of config to define graphql mutations and queries. For example
import { createStar } from 'redux-nakshatra';
import { take, put } from 'redux-saga/effects';
import gql from 'graphql-tag';
import { apolloClient } from '../store/apolloClient';

export const { types, actions, rootReducer, rootSaga } = createStar({
  name: 'blogItem',
  log: true,
  graphql: {
    client: apolloClient,
    add: {
      getBlogItems: {
        query: gql`
          query {
            allBlogItems {
              id
              title
              author
              image
            }
          }
        `
      },
      getBlogItem: {},
      createBlogItem: {},
      updateBlogItem: {},
      removeBlogItem: {}
    }
  },
  reducer: function(state, action) {
    switch (action.type) {
      case types.updateBlogItem_SUCCESS: {
        const updatedIndex = state.getBlogItems.data.allBlogItems.findIndex(obj => action.response.data.updateBlogItem.id === obj.id);
        const newAllBlogItems = [...state.getBlogItems.data.allBlogItems];
        newAllBlogItems[updatedIndex] = action.response.data.updateBlogItem;
        const newGetBlogItems = {
          data: {
            allBlogItems: newAllBlogItems
          }
        };
        return {
          ...state,
          getBlogItems: {
            ...newGetBlogItems
          }
        };
      }
      case types.createBlogItem_SUCCESS: {
        const newAllBlogItems = [...state.getBlogItems.data.allBlogItems, action.response.data.createBlogItem];
        const newGetBlogItems = {
          data: {
            allBlogItems: newAllBlogItems
          }
        };
        return {
          ...state,
          getBlogItems: {
            ...newGetBlogItems
          }
        };
      }
      default:
        return state;
    }
  }
});

How to invoke mutations
You can pass in mutation graphql query through the actions that are generated. For example for the createBlogItem action that is generated you can invoke it as follows
const length = (this.props.blogItems.getBlogItems.data.allBlogItems && this.props.blogItems.getBlogItems.data.allBlogItems.length) || 0;
this.props.actions.createBlogItem({
  variables: {
    title: faker.lorem.words(),
    author: faker.name.findName(),
    author_image: faker.image.avatar(),
    release_date: faker.date.recent(),
    image: faker.image.nature(),
    short_description: faker.lorem.sentence(),
    long_description: faker.lorem.paragraphs(),
    id: length
  },
  mutation: gql`
    mutation createBlogItem(
      $title: String!
      $author: String!
      $author_image: String!
      $release_date: String!
      $image: String!
      $short_description: String!
      $long_description: String!
      $id: ID!
    ) {
      createBlogItem(
        title: $title
        author: $author
        author_image: $author_image
        release_date: $release_date
        image: $image
        short_description: $short_description
        long_description: $long_description
        id: $id
      ) {
        id
        title
        author
        author_image
        release_date
        image
        short_description
        long_description
      }
    }
  `
});

docs/config/custom.html.body:
And sometimes you need to write a fully custom saga may be aggregating data from different end points (http, graphql or local state or anything) In this case, you can do something similar as shown below
import { take, call, put, all, fork, race, select } from 'redux-saga/effects';
import { createStar } from 'redux-nakshatra';
import axios from 'axios';

export const { rootSaga, types, actions, rootReducer } = createStar({
  name: 'users',
  http: {
    url: 'http://localhost:5000/users',
    generateDefault: true
  },
  custom: {
    getUsersAndFriends: {
      saga: function* watchGetUsersAndFriendsRequestSaga(dispatch) {
        while (true) {
          const request = yield take(types.getUsersAndFriends_REQUEST);
          try {
            yield put({
              type: types.getUsers_REQUEST
            });

            yield race([types.getUsers_SUCCESS, types.getUsers_FAILURE]);
            const getUsers = yield select(state => state.getUsers);
            const userIds = getUsers.data.map(o => o.id);
            const getFriendsForUsers = yield call(() =>
              axios({
                url: 'http://localhost:5000/friends',
                data: {
                  userIds
                }
              })
            );
            const result = getUsers.data.map((user, index) => {
              return {
                ...user,
                friend: getFriendsForUsers.data[index]
              };
            });
            yield put({
              type: types.getUsersAndFriends_SUCCESS,
              response: result
            });
          } catch (error) {
            yield put({
              type: types.getUsersAndFriends_FAILURE,
              response: error
            });
          }
        }
      }
    }
  }
});

If you need more low level control, you can add more actions, types, initialState, reducer, sagas separately as well. Example
import { createStar } from 'redux-nakshatra';
import { take, put, race, select } from 'redux-saga/effects';
import { MediaPlayerStatus } from '../constants/mediaPlayerStatus';
import { Howl } from 'howler';

const MediaPlayerActionTypes = {
  playPause_REQUEST: 'playPause_REQUEST',
  playPause_SUCCESS: 'playPause_SUCCESS',
  playPause_FAILURE: 'playPause_FAILURE',
  updateCurrentTrack_REQUEST: 'updateCurrentTrack_REQUEST',
  updateCurrentTrack_SUCCESS: 'updateCurrentTrack_SUCCESS',
  updateCurrentTrack_FAILURE: 'updateCurrentTrack_FAILURE',
  updateStatus: 'updateStatus'
};

const initialState = {
  status: MediaPlayerStatus.PAUSED,
  currentTrack: null,
  updateCurrentTrackFailureMessage: null,
  updateCurrentTrackInProgress: true,
  isLoopingCurrentTrack: false,
  tracks: [
    {
      id: 1,
      title: 'Rave Digger',
      file: 'rave_digger',
      howl: null
    },
    {
      id: 2,
      title: '80s Vibe',
      file: '80s_vibe',
      howl: null
    },
    {
      id: 3,
      title: 'Running Out',
      file: 'running_out',
      howl: null
    }
  ]
};

export const { rootSaga, types, actions, rootReducer } = createStar({
  name: 'mediaPlayer',
  types: MediaPlayerActionTypes,
  actions: {
    updateCurrentTrack(track) {
      return {
        type: MediaPlayerActionTypes.updateCurrentTrack_REQUEST,
        track
      };
    },
    playPause(track) {
      return {
        type: MediaPlayerActionTypes.playPause_REQUEST,
        track
      };
    },
    updateMediaPlayerStatus(status) {
      return {
        type: MediaPlayerActionTypes.updateStatus,
        status
      };
    }
  },
  initialState,
  reducer(state = initialState, action) {
    switch (action.type) {
      case MediaPlayerActionTypes.updateStatus: {
        return {
          ...state,
          status: action.status
        };
      }
      case MediaPlayerActionTypes.updateCurrentTrack_REQUEST: {
        return {
          ...state,
          updateCurrentTrackFailureMessage: null,
          updateCurrentTrackInProgress: true
        };
      }
      case MediaPlayerActionTypes.updateCurrentTrack_SUCCESS: {
        return {
          ...state,
          currentTrack: action.track,
          updateCurrentTrackInProgress: false
        };
      }
      case MediaPlayerActionTypes.updateCurrentTrack_FAILURE: {
        return {
          ...state,
          updateCurrentTrackFailureMessage: action.response,
          updateCurrentTrackInProgress: false
        };
      }
      default:
        return state;
    }
  },
  sagas: {
    *watchUpdateCurrentTrackRequest(dispatch) {
      while (true) {
        const request = yield take(MediaPlayerActionTypes.updateCurrentTrack_REQUEST);

        const track = {
          ...request.track,
          howl: new Howl({
            src: ['./audio/' + request.track.file + '.webm', './audio/' + request.track.file + '.mp3'],
            volume: 1,
            html5: true,
            onplay: function() {
              dispatch({
                type: types.updateStatus,
                status: MediaPlayerStatus.PLAYING
              });
            },
            onload: function() {
              dispatch({
                type: types.updateStatus,
                status: MediaPlayerStatus.LOADED
              });
            },
            onend: function() {
              dispatch({
                type: types.updateStatus,
                status: MediaPlayerStatus.ENDED
              });
            },
            onpause: function() {
              dispatch({
                type: types.updateStatus,
                status: MediaPlayerStatus.PAUSED
              });
            },
            onstop: function() {
              dispatch({
                type: types.updateStatus,
                status: MediaPlayerStatus.STOPPED
              });
            }
          })
        };
        try {
          yield put({
            type: MediaPlayerActionTypes.updateCurrentTrack_SUCCESS,
            track
          });
        } catch (error) {
          console.log(error);
          yield put({
            type: MediaPlayerActionTypes.updateCurrentTrack_FAILURE,
            response: error
          });
        }
      }
    },
    *watchPlayPauseRequestSaga() {
      while (true) {
        const request = yield take(MediaPlayerActionTypes.playPause_REQUEST);
        try {
          const currentTrack = yield select(state => state.mediaPlayer.currentTrack);
          if (currentTrack === null || (currentTrack && currentTrack.id !== request.track.id)) {
            if (currentTrack) {
              currentTrack.howl.pause();
            }

            yield put({
              type: MediaPlayerActionTypes.updateCurrentTrack_REQUEST,
              track: request.track
            });
            yield race([take(MediaPlayerActionTypes.updateCurrentTrack_SUCCESS), take(MediaPlayerActionTypes.updateCurrentTrack_FAILURE)]);

            const updateCurrentTrackFailureMessage = yield select(state => state.mediaPlayer.updateCurrentTrackFailureMessage);
            if (updateCurrentTrackFailureMessage) {
              throw updateCurrentTrackFailureMessage;
            } else {
              const updatedCurrentTrack = yield select(state => state.mediaPlayer.currentTrack);
              updatedCurrentTrack.howl.play();
            }
          }

          if (currentTrack && currentTrack.id === request.track.id) {
            const status = yield select(state => state.mediaPlayer.status);
            if (status === MediaPlayerStatus.PLAYING) {
              currentTrack.howl.pause();
            } else {
              currentTrack.howl.play();
            }
          }

          yield put({
            type: MediaPlayerActionTypes.playPause_SUCCESS
          });
        } catch (error) {
          yield put({
            type: MediaPlayerActionTypes.playPause_FAILURE,
            response: error
          });
        }
      }
    }
  }
});
